import img1 from "../assets/DuocUCLogo.png";
import img2 from "../assets/OfCourseAmarillo.png";

export default function AuthLogo() {
  return (
    <section className="bg-duocazul py-16">
      <div className="relative max-w-2xl mx-auto">
        {/* Im√°genes sobre el div (una encima de la otra) */}
        <div className="absolute inset-x-0 -top-10 z-10 flex flex-col items-center gap-2 pointer-events-none">
          <img
            src={img1}
            alt="Imagen superior"
            className="w-24 h-24 object-cover rounded-full ring-4 ring-white shadow-lg"
          />
          <img
            src={img2}
            alt="Imagen inferior"
            className="w-16 h-16 object-cover rounded-full ring-4 ring-white shadow-md"
          />
        </div>
      </div>
    </section>
  );
}
